INSERT INTO `mail_templates` VALUES (32,'reset_password','Reset Password','{$logo}<br><br>Hello {$customer_fullname}<br><br>We\'ve sent this message because you, or someone else submitted a request to reset your password.<br>If you did not request a password reset then please ignore this email.<br>To access your account you\'ll need to upgrade to a registered login account.<br><br>Email: {$customer_email}<br>{$password_reset_link}<br><br>Regards<br>{$admin_username}<br>',0,'',1),(33,'admin_reply_from_order','Your appointment (#{$appt_id}) status updated','<br>{$logo}<br><br>Hello&nbsp;{$customer_fullname},<br><br>Your appointment (#{$appt_id}) status is&nbsp;<b>{$appt_status}</b><br><br>Regards,<br>{$admin_panel_name}<br><br>',1,'Sent from {$site_name} - Your order ({$appt_id}) status is {$appt_status}',1),(39,'signup_verification_for_email','Signup Verification Code  From {$from_name}','<br>{$logo}<br><br>Hello&nbsp;{$customer_fullname},<br><br>You have requested a verification code for login. Your OTP is {$verification_code} which can be used only once. Please do not share this with anyone.<br><span>In case you have not initiated this transaction or face any concerns, please reach out to us on {$admin_phone}.<br><br>{$verification_link}<br></span><br>Regards,<br>{$admin_username}',1,'Sent from {$site_name} - Your {$from_name} confirmation code is {$verification_code}.',1),(41,'customer_profile_edit_from_admin','Your profile edit by administrator','<br>{$logo}<br><br>Hello&nbsp;{$customer_fullname},<br><br>Your profile edited by administrator so&nbsp;please see your details,<br><br>Your Account status is:&nbsp;<b>{$customer_status}</b><br><br>First Name:&nbsp;{$customer_fname}<br>Last Name:&nbsp;{$customer_lname}<br>Phone:&nbsp;{$customer_phone}<br>Email:&nbsp;{$customer_email}<br>Temp. Password:&nbsp;{$customer_password}<br>Address Line1:&nbsp;{$customer_address_line1}<br>Address Line2:&nbsp;{$customer_address_line2}<br>City:&nbsp;{$customer_city}<br>State:&nbsp;{