INSERT INTO `pages` VALUES (1,0,0,0,0,0,0,'',0,'','how-it-works',0,0,'How it works',1,'20200127153541.jpg','Image Text...',0,'How it works','How it works','','How it works. It is quick and device repairs. We offer instant quotes, on site repairs (coming soon) and in store repair services.','<div class=\"container clearfix\">\r\n	<div class=\"col_one_third bottommargin-sm center\">\r\n		<img data-animate=\"fadeInLeft\" src=\"https://repairmytek.com/images/iphone_6_mockup_new.jpg\" alt=\"Iphone\">\r\n	</div>\r\n	<div class=\"col_two_third bottommargin-sm col_last\">\r\n		<div class=\"heading-block topmargin-sm\">\r\n			<h3>AT REPAIR DEVICE WE MAKE LIFE EASY</h3>\r\n		</div>\r\n		<p>We know life (and schedules) can be tricky so we made it an important point to have our whole process be quick, simple and hassle free.</p>\r\n		<p>All of our work is also 100% guaranteed!</p>\r\n		<p>Most of our repairs are completed in 15 to 20 minutes.</p>\r\n		<a href=\"https://repairmytek.com/phone-repair-near-me\" class=\"button button-border button-dark button-rounded button-large noleftmargin topmargin-sm\">Book a Service</a>\r\n	</div>\r\n</div>\r\n\r\n<div class=\"container topmargin-sm clearfix\">\r\n<div class=\"col_half\">\r\n	<div class=\"feature-box fbox-center fbox-bg fbox-outline fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"i-alt\">1</i></a>\r\n		</div>\r\n		<h3 class=\"nobottommargin\">We gather some quick info</h3>\r\n		<h3>Who, <u>What</u>, When, How Much?<span class=\"subtitle\">Navigate our easy wizard to search for your device by name, brand or model number to locate your device. Then tell us what is wrong with it and price is revealed. The whole process takes less than a minute!</span></h3>\r\n	</div>\r\n</div>\r\n<div class=\"col_half col_last\">\r\n	<div class=\"feature-box fbox-center fbox-bg fbox-outline fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i>2</i></a>\r\n		</div>\r\n		<h3 class=\"nobottommargin\">We provide you an instant price quote</h3>\r\n		<h3>Who, What, When, <u>How Much?</u><span class=\"subtitle\">What you see is what you pay. Applicable taxes and warranty have already been applied. Additional charges may apply for heavy frame damage, water damage or other unreported issues.</span></h3>\r\n	</div>\r\n</div>\r\n<div class=\"col_half\">\r\n	<div class=\"feature-box fbox-center fbox-bg fbox-outline fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i>3</i></a>\r\n		</div>\r\n		<h3 class=\"nobottommargin\">You book a service</h3>\r\n		<h3><u>Who</u>, What, <u>When</u>, How Much?<span class=\"subtitle\">Let us know when you can make it in and we will reserve a technician and the necessary parts for your repair. You then stop by and we will handle the rest!</span></h3>\r\n	</div>\r\n</div>\r\n<div class=\"col_half col_last\">\r\n	<div class=\"feature-box fbox-center fbox-bg fbox-outline fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"i-alt\">4</i></a>\r\n		</div>\r\n		<h3 class=\"nobottommargin\">You enjoy your revived device!</h3>\r\n		<h3>And help us grow by spreading the word.<span class=\"subtitle\">We are local, family owned and operated business. We thrive on word of mouth. Please help to be a part of our success.</span></h3>\r\n	</div>\r\n</div>\r\n</div>',1,'2017-09-19 07:20:56','2020-03-19 05:10:15','','',''),(2,0,0,0,0,0,0,'',0,'','why',0,0,'Why use us?',1,'20200128073750.jpg','Image Text...',1,'Why use us?','Why use us?','','Why use us?','<div class=\"container topmargin-sm clearfix\">\r\n<div class=\"col_full\">\r\n	<div class=\"feature-box fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"icon-handshake i-alt\"></i></a>\r\n		</div>\r\n		<h3>Why use us?</h3>\r\n		<p>We have been professionally repairing devices since the original iPhone was released. We have fixed thousands of devices since we started and we look forward to fixing thousands more.</p>\r\n	</div>\r\n</div>\r\n<div class=\"col_half\">\r\n	<div class=\"feature-box fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"icon-dollar i-alt\"></i></a>\r\n		</div>\r\n		<h3>The price you see, is the price you get. Guaranteed.</h3>\r\n		<p>We promise to pay you 100% of the value quoted or your phone back FREE of charge. No nasty inflated \'up to\' prices to tempt you in and leave you disappointed.</p>\r\n	</div>\r\n</div>\r\n<div class=\"col_half col_last\">\r\n	<div class=\"feature-box fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"icon-clock i-alt\"></i></a>\r\n		</div>\r\n		<h3>Our fast payment really is the fastest.</h3>\r\n		<p>You want your money. You want it fast. So we promise to send your payment on the same day we receive your phone! Our FPS bank transfers clear in your account on the same day. No slow BACS payments which take 3 working days.</p>\r\n	</div>\r\n</div>\r\n<div class=\"col_half\">\r\n	<div class=\"feature-box fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"icon-money i-alt\"></i></a>\r\n		</div>\r\n		<h3>Fixed prices for both working and faulty.</h3>\r\n		<p>We think you should know exactly how much youâ€™re going to get for your phone up front, whether your phone is working or faulty, rather than having to send it off and waiting for it to be assessed and valued. Saves any disappointment!</p>\r\n	</div>\r\n</div>\r\n<div class=\"col_half col_last\">\r\n	<div class=\"feature-box fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"icon-credit-card i-alt\"></i></a>\r\n		</div>\r\n		<h3>No hidden fees for repairing a device that eat into the cash you pay.</h3>\r\n		<p>The Price we charge is the price as per selected conditions of device. No hidden costs included into the amount you are willing to pay.</p>\r\n	</div>\r\n</div>\r\n<div class=\"col_half\">\r\n	<div class=\"feature-box fbox-effect\">\r\n		<div class=\"fbox-icon\">\r\n			<a href=\"#\"><i class=\"icon-thumbs-up i-alt\"></i></a>\r\n		</div>\r\n		<h3>Simple, fair conditions that won\'t catch you out.</h3>\r\n		<p>We\'ve made sure our conditions are fair and simple to understand. No nasty small print to catch you out and leave you disappointed.</p>\r\n		\r\n	</div>\r\n</div>\r\n</div>\r\n\r\n<p class=\"text-center\"><a title=\"Link: #\" class=\"button btn btn-outline-primary\" href=\"#\">Action Button</a></p>',1,'2017-09-19 07:42:37','2020-01-28 07:37:50','','',''),(14,0,0,0,0,0,0,'',0,'','contact-us',0,0,'Contact us',1,'20200127134042.jpg','Image Text...',1,'contact meta title','contact meta keywords','','contact meta desc','<p>if you are interested in getting a quote for any of our services, then you can use the below form and we will get back to you as soon as possible.</p>',1,'2017-09-20 00:54:06','2020-01-27 13:45:35','inbuild','contact',''),(8,0,0,0,0,0,0,'',0,'','repairs',0,0,'Repair My Device',1,'20200127132540.jpg','Image Text....',1,'Repairs Near Me','Phone Repair  Screen Repair Near Me','','Professional  Repair Services Near Me','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.',1,'2017-09-19 23:33:21','2020-03-19 09:46:54','inbuild','repair-my-mobile',''),(13,0,0,0,0,0,0,'',0,'','',0,0,'Get your Device Repaired Today!',1,'20180510064914.png','',0,'Get your Device Repaired Today!','Get your Device Repaired Today!','','Get your Device Repaired Today!','<strong>How much will my repair cost?</strong>',1,'2017-09-20 00:51:28','2020-03-19 0